/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div class="ui5-toast-root"	role="alert"	style="${styleMap(context.styles.root)}"	dir="${ifDefined(context.rtl)}"	@mouseover="${context._onmouseover}"	@mouseleave="${context._onmouseleave}"	@transitionend="${context._ontransitionend}"><bdi><slot></slot></bdi></div>`; };

export default block0;
